      var banner,

      function announceLoad(e) {
        for (
          var n = e.currentTarget || e.srcElement,
            a = imageLoadTracker.length,
            o = 0;
          o < a;
          o++
        )
          if (n.id == imageLoadTracker[o]) {
            imageLoadTracker.splice(o, 1);
            break;
          }
        imageLoadTracker.length <= 0 && init();
      }
      function init() {
        (document.getElementById("cover").style.display = "none"),
          (document.getElementById("banner").style.display = "block"),
          (banner = document.getElementById("banner")).addEventListener(
            "mouseenter",
            onMouseEnter
          ),
          banner.addEventListener("mouseleave", onMouseLeave),
          mainTl.call(onMouseEnter, null, 1.5).call(onMouseLeave, null, ">1");
      }
      function onMouseEnter() {
        gsap.to(ctaArrow, 0.2, { x: "5", ease: "power1.inOut" });

        gsap.to(ctaArrow, 0.2, { x: "0", ease: "power1.inOut" });
